import BullContainer from "./BullContainer";

import {useState} from 'react'

const BullRow = (props) => {



    return(
        <div className="row">
           {props.upperStocks.map(data =>
               <BullContainer onClick={() => props.handleSymbolBoxClick()} key={data.id} data={data}/>
               )}    
        </div>
    )
}

export default BullRow;
